Having regard to the Treaty establishing the European Economic Community,
Having regard to Council Regulation (EEC) No 234/79 of 5 February 1979 on the procedure for adjusting the Common Customs Tariff nomenclature used for agriculture products (1), as last amended by Regulation (EEC) No 3209/89 (2), and in particular Article  2 thereof,
Whereas the Annex to Council Regulation (EEC) No 804/68 (3), as last amended by Regulation (EEC) No 1630/91 (4), includes 'Muesli' type breakfast cereals within CN code 2106;
Whereas these products were reclassified on 1 January 1992 and now fall within CN code 2008;
Whereas, therefore, the Annex to Regulation (EEC) No 804/68 should be changed with effect from that date;
Whereas the measures provided for in this Regulation are in accordance with the opinion of the Management Committee for Milk and Milk Products,
